INSERT INTO `webdev_posts` VALUES (2,1,'2017-08-02 15:09:43','2017-08-02 15:09:43','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://webdev.ultrabase.net/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2017-08-02 15:09:43','2017-08-02 15:09:43','',0,'http://webdev.ultrabase.net/?page_id=2',0,'page','',0),(5,1,'2017-08-02 18:34:40','2017-08-02 18:34:40','Destacado 1','Destacado 1','','publish','open','open','','destacado-1','','','2017-08-02 18:34:40','2017-08-02 18:34:40','',0,'http://webdev.ultrabase.net/?p=5',0,'post','',0),(6,1,'2017-08-02 18:34:34','2017-08-02 18:34:34','','1070x441','','inherit','open','closed','','1070x441','','','2017-08-02 18:34:34','2017-08-02 18:34:34','',5,'http://webdev.ultrabase.net/wp-content/uploads/2017/08/1070x441.png',0,'attachment','image/png',0),(7,1,'2017-08-02 18:34:40','2017-08-02 18:34:40','Destacado 1','Destacado 1','','inherit','closed','closed','','5-revision-v1','','','2017-08-02 18:34:40','2017-08-02 18:34:40','',5,'http://webdev.ultrabase.net/2017/08/02/5-revision-v1/',0,'revision','',0),(8,1,'2017-08-02 18:35